import React from "react";
import OrganisationTable from "./OrganisationTable";

function Dashboard() {
  const tenantId = 1; // Example tenant ID
  const tenantName = "Example Tenant"; // Example tenant name

  return (
    <div>
      <h1>Organisations</h1>
      <OrganisationTable tenantId={tenantId} tenantName={tenantName} />
    </div>
  );
}

export default Dashboard;
